import { Provider } from 'react-redux';
import ReactDOM from 'react-dom';
import App from './App';
//import store from './store';
import 'bootstrap/dist/css/bootstrap.min.css';

ReactDOM.render(
  <Provider >
    <App />
  </Provider>, document.getElementById('root'));
